window.bookSummaryJSON = "<p><i>Chop Wood Carry Water</i> is the story of one boy's journey to achieve his lifelong dream of becoming a samurai warrior. Guided by \"Akira-sensei\", John comes to realize the greatest adversity on his journey will be the challenge of defeating the man in the mirror. </p> <p>This powerful story brings the train-to-be-clutch curriculum to life in a powerful and memorable way. </p> <p>Some things you will learn.... </p> <p></p> <ul> <li>No matter how it feels, you are always building your own house. </li> <li>How and why you must surrender the outcome in order to be at your best. </li> <li>Why you never want to have your identity wrapped up in what you do. </li> <li>Why your strength lies in faithfulness to the little things. </li> <li>How to develop a heart posture of gratitude. </li> <li>How to use the biggest challenges as a training ground for greatness. </li> <li>Why the process is more important than the goal. </li> <li>Why comparison is the thief of all joy. </li> <li>How to develop a growth mindset. </li> <li>Why talent is more of a curse than a blessing. </li> </ul> <p></p>"; 
